CREATE FUNCTION public.customer_owner_number_update_division_owner() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    UPDATE division_owner SET owner_number = NEW.owner_number
    WHERE
        division_order_uid = (SELECT B.division_order_uid FROM division_order B WHERE B.lessee_id = NEW.customer_uid)
    AND
        owner_number = OLD.owner_number;
    RETURN NEW;
END
$$;


