--

CREATE FUNCTION public.get_postgres_version() RETURNS numeric
    LANGUAGE plpgsql
    AS $$
/* ***************************************************************
   FUNCTION: public.get_postgres_version()
   DESC:     Returns the version of postgres. Major version and one decimal. 
 
   USED BY:  notification
				
   MODIFIED: 
		   - RA 20190706 created. O
****************************************************************** */
DECLARE
	vDBVersion varchar;
	vMajorDBVersion varchar;
	vMinorDBVersion varchar;
	show_debug_info boolean DEFAULT FALSE;
	vVersion numeric;
	vSql text;
	
BEGIN
-- 	show_debug_info := true;
	-- example string returned by version(): "PostgreSQL 9.5.3 on x86_64-apple-darwin, compiled by i686-apple-darwin11-llvm-gcc-4.2 (GCC) 4.2.1 (Based on Apple Inc. build 5658) (LLVM build 2336.11.00), 64-bit"
	vDBVersion := substring(version(), position(' ' in version())+1, char_length(version())); -- strips 'PostgreSQL ' from beginning of string.
	IF show_debug_info THEN
		RAISE INFO 'version(): %', version();
		RAISE INFO 'vDBVersion: %', vDBVersion;
	END IF;
	
	vDBVersion := substring(vDBVersion, 1, position(' ' in vDBVersion)-1); -- strips everything after version number.
	IF show_debug_info THEN
		RAISE INFO 'vDBVersion: %', vDBVersion;
	END IF;
	
	vMajorDBVersion := substring(vDBVersion, 1, position('.' in vDBVersion)-1); -- returns up to first decimal place.
	IF show_debug_info THEN
		RAISE INFO 'vMajorDBVersion: %', vMajorDBVersion;
	END IF;
	
	vMinorDBVersion := substring(vDBVersion, position('.' in vDBVersion)+1, char_length(vDBVersion)); -- returns all after first decimal place.
	IF show_debug_info THEN
		RAISE INFO 'vMinorDBVersion: %', vMinorDBVersion;
	END IF;
	
	IF position('.' in vMinorDBVersion) > 0 THEN -- if there's a second decimal, remove all after it.
		vMinorDBVersion := substring(vMinorDBVersion, 1, position('.' in vMinorDBVersion)-1); -- strips all from second decimal place.
		IF show_debug_info THEN
			RAISE INFO 'vMinorDBVersion: %', vMinorDBVersion;
		END IF;
	END IF;
	
	vDBVersion := vMajorDBVersion || '.' || vMinorDBVersion; -- strips everything after version number.
	IF show_debug_info THEN
		RAISE INFO 'vDBVersion: %', vDBVersion;
	END IF;
	
	vVersion := vDBVersion::numeric; -- convert to number.
	IF show_debug_info THEN
		RAISE INFO 'vVersion: %', vVersion;
	END IF;

	return vVersion;
END;

$$;


