-- Name: lease_prod_status(integer); Type: FUNCTION; Schema: public; Owner: prm_master
--

CREATE FUNCTION public.lease_prod_status(pleaseuid integer, OUT pstatus text, OUT pstatuscode integer) RETURNS record
    LANGUAGE plpgsql
    AS $$

/* ***************************************************************
   FUNCTION: public.lease_prod_status(integer)
   
   DESC:	 Return lease production status.
   
   VERSION:	 v1.01

   PARMS:    lease_uid integer
             
   USED BY:  Financial, Receipts
                            
   MODIFIED: 
             - RA 20181227 0011820 Update lease_prod_status function to handle deadfiled check. - v1.01
				lease_prod_status is not mentioned in Pops. It is not used in any other 
				views or functions in postgres (prm_0001_r4000_dev).
				If it were to be used, it makes sense to return a notice when lease is deadfiled, 
				and not to include rcpt_dist, division_order, legal_desc_div, or legal_desc_lease 
				in totals if they are deadfiled.
				New return value; ('Removed/Inactive', 5) added.

****************************************************************** */

    DECLARE
       termYears integer;
       termAcreRental   real;
       expireDate date;  
       rentalSum real;
       divisionOrdersNoroyalty int;
       divisionOrdersRoyalty int;
       max_do_date date;
       lease_deadfiled boolean; -- RA 20181227 0011820

       
    BEGIN
       -- Get lease table info for testing
       SELECT term_years, term_acre_rental, date_effective + ((interval '1 year') * (term_years)), deadfiled
       INTO termYears, termAcreRental, expireDate, lease_deadfiled
       FROM lease
       where lease_uid = pLeaseUid; -- AND coalesce(deadfiled,false) = false; -- ignore deadfiled rows

       -- Get rental sum from rcpt_dist table
       SELECT sum(owner_net_amt)
       INTO rentalSum
       FROM rcpt_dist
       WHERE lease_uid = pLeaseUid and rcpt_type_uid = 6 AND coalesce(deadfiled,false) = false  -- 6 is rental -- ignore deadfiled rows
       GROUP BY pLeaseUid;

       -- Get royalty division order Information if there is no royalty reveived
       SELECT count(dv.division_order_uid)
       INTO divisionOrdersNoroyalty
       FROM division_order dv, division_lease dl, legal_desc_div ldd, legal_desc_lease ldl
       WHERE dv.division_order_uid = ldd.division_order_uid
             and ldd.legal_desc_div_uid = dl.legal_desc_div_uid
             and dl.legal_desc_lease_uid = ldl.legal_desc_lease_uid 
             and ldl.lease_uid = pLeaseUid 
			 AND coalesce(dv.deadfiled,false) = false -- ignore deadfiled rows
			 AND coalesce(ldd.deadfiled,false) = false 
			 AND coalesce(ldl.deadfiled,false) = false
       GROUP BY dv.division_order_uid;

       -- Get royalty division order Information if royalty has been reveived
       SELECT count(rd.rcpt_dist_uid)
       INTO divisionOrdersRoyalty
       FROM rcpt_dist rd, division_lease dl, legal_desc_div ldd, legal_desc_lease ldl
       WHERE rd.division_order_uid = ldd.division_order_uid
             and ldd.legal_desc_div_uid = dl.legal_desc_div_uid
             and dl.legal_desc_lease_uid = ldl.legal_desc_lease_uid 
             and ldl.lease_uid = pLeaseUid and rd.rcpt_type_uid = 4  -- 4 is royalty
             and rd.division_order_uid > 0
			 AND coalesce(rd.deadfiled,false) = false -- ignore deadfiled rows
			 AND coalesce(ldd.deadfiled,false) = false 
			 AND coalesce(ldl.deadfiled,false) = false
       GROUP BY rd.rcpt_dist_uid;       

        -- RAISE NOTICE '% % % % %',expireDate, termAcreRental, rentalSum, pLeaseUid, termYears ;          

      -- termAcreRental termYears rentalSum 


      --   Handle NULL values
       IF divisionOrdersNoroyalty IS NULL THEN
           divisionOrdersNoroyalty := 0;
       END IF;

       IF divisionOrdersRoyalty IS NULL THEN
           divisionOrdersRoyalty := 0;
       END IF;
       

        -- RAISE NOTICE '% %', divisionOrdersNoroyalty, divisionOrdersRoyalty;

       -- Now we test for the various lease statuses
       IF lease_deadfiled = true THEN -- RA 20181227 0011820
             pStatus := 'Removed/Inactive';
             pStatusCode := 5;		
       ELSIF divisionOrdersNoroyalty = 0 and divisionOrdersRoyalty = 0 THEN -- no division orders yet
          IF now() >= expireDate and rentalSum <= termYears * termAcreRental THEN
             pStatus := 'Expired';
             pStatusCode := 1;
          ELSE
             pStatus := 'Active';
             pStatusCode := 2;
          END IF;
       ELSIF divisionOrdersNoRoyalty > 0 and divisionOrdersRoyalty = 0 THEN
             pStatus := 'In Suspense';
             pStatusCode := 3;
       ELSE 
             pStatus := 'Held By Production';
             pStatusCode := 4;
       END IF; 

       --  RAISE NOTICE '% %' ,pStatus, pStatusCode ;

    END;
    $$;


