		, t.pmt_dist_type_name
		, COALESCE(d.sale_amt, 0.00)  AS sale_amt
		, COALESCE(d.owner_amt, 0.00) AS owner_amt
		, d.gl_account
		, t.required
		, t.sort_order
		, t.pmt_dist_type_uid
		, d.pmt_dist_uid
		, d.pmt_dist_detail_uid 
	FROM
