		LEFT JOIN pmt_dist pd ON pd.pmt_dist_uid = IN_pmt_dist_uid AND coalesce(pd.deadfiled,false) = false -- RA 20190124 0011822 v1.01
		LEFT JOIN pmt_dist_detail d ON d.pmt_dist_type_uid = t.pmt_dist_type_uid AND d.pmt_dist_uid = pd.pmt_dist_uid AND coalesce(d.deadfiled,false) = false -- RA 20190124 0011822 v1.01
	ORDER BY
		t.sort_order;
END
$_$;


