    LANGUAGE plpgsql
    AS $$
/* ****************************************************************
   FUNCTION: public.list_titles_for_customer(integer)
   
   DESC:	Titles related to a customer

   VERSION:	v1.01

   PARMS:	cust_uid integer
             
   USED BY:	oCustomer
                            
   MODIFIED: 
		- RA 20190121 0011825: Update list_titles_for_customer function to handle deadfiled check   v1.01.
			list_titles_for_customer is used in Pops by oCustomer. It is not used in any other views or functions in postgres (prm_0001_r4000_dev).
			Suppress a row when any of the related rows is deadfiled.
****************************************************************** */

