	JOIN lease e ON e.lease_uid = d.lease_uid AND coalesce(e.deadfiled,false) = false -- RA 20190121 0011825 v1.01
    WHERE e.customer_uid = cust_uid
UNION 
SELECT DISTINCT a.ttl_code
	, a.ttl_desc
	, a.ttl_interest
	, a.ttl_gross_acres
	, a.ttl_net_acres
        , (select v.ctname || ', ' || v.stname as county_state from vw_state_county v where v.ctnum = a.ctnum) as county_state
