	JOIN legal_desc_title b ON b.legal_title_uid = a.legal_title_uid AND coalesce(b.deadfiled,false) = false -- RA 20190121 0011825 v1.01
	JOIN division_title C ON C.legal_desc_title_uid = b.legal_desc_title_uid
