CREATE FUNCTION public.list_well_names(in_ct_num integer, in_node_level integer) RETURNS TABLE(well_name text, well_uid integer)
    LANGUAGE plpgsql
    AS $$

/* ****************************************************************
   FUNCTION: public.list_well_names(integer, integer)
   
   DESC:	Titles related to a customer

   VERSION:	v1.01

   PARMS:	in_ct_num integer, in_node_level integer
             
   USED BY:	oCustomer
                            
   MODIFIED: 
		- RA 20190121 0011826: Update list_well_names function to handle deadfiled check.  v1.01.
			list_well_names is used in Pops by oTAList_well. It is not used in any other views or functions in postgres (prm_0001_r4000_dev).
			Suppress a row when well is deadfiled.
****************************************************************** */

DECLARE
	where_clause text;
BEGIN
	CASE in_node_level
	WHEN 1 THEN
		where_clause := ' WHERE A.ctnum > ' || in_ct_num*1000 || ' AND A.ctnum < ' || (in_ct_num*1000)-1  || ' AND coalesce(a.deadfiled,false) = false '; -- RA 20190121 0011826
	WHEN 2 THEN
		where_clause := ' WHERE A.ctnum = ' || in_ct_num  || ' AND coalesce(a.deadfiled,false) = false '; -- RA 20190121 0011826
	ELSE
		where_clause := ' WHERE coalesce(a.deadfiled,false) = false '; -- RA 20190121 0011826
	END CASE;

	RETURN QUERY EXECUTE 'SELECT CASE 
		WHEN A.well_number = '''' THEN
			A.well_name
		WHEN A.well_number = A.well_name THEN
			A.well_name
		ELSE
			''('' || A.well_number || '') '' || A.well_name
		END AS well_name
		, A.well_uid
	FROM well A
	' || where_clause || '
	ORDER BY LOWER(A.well_name)';
END
$$;


