--
-- TOC entry 540 (class 1255 OID 18648)
-- Name: update_first_last_paid(); Type: FUNCTION; Schema: public; Owner: prm_master
--

CREATE FUNCTION public.update_first_last_paid() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
/* ***************************************************************
   FUNCTION: public.update_first_last_paid()
   DESC:     Update the date first paid and date last paid columns in the Division Order, Lease, and Customer Owner Number tables, as required, when ever a receipt is input or updated.
 
   VERSION:	v1.00

   PARMS:	

   USED BY:  receipts, rcpt_dist
				
   MODIFIED: 
		   - RA 20190319 0016879 Create autopopulate function first and latest payment SOI Lease receipts. Created v1.00.
		   - RA 20190319 0016878 Create autopopulate function first and latest payment SOI Lease receipts. Created v1.00.
****************************************************************** */
DECLARE
	show_debug_info boolean DEFAULT false; -- true false
	rcpt_hdr_row			rcpt_hdr%ROWTYPE;
	division_order_row		division_order%ROWTYPE;
	lease_row			lease%ROWTYPE;
	well_row			well%ROWTYPE;
	customer_owner_number_row	customer_owner_number%ROWTYPE;

BEGIN

	IF show_debug_info THEN
		RAISE INFO 'Start';
	END IF;

	SELECT * INTO rcpt_hdr_row
	FROM rcpt_hdr 
	WHERE rcpt_hdr_uid = NEW.rcpt_hdr_uid;
	
	IF show_debug_info THEN
		RAISE INFO 'rcpt_hdr.rcpt_date: %, NEW.rcpt_type_uid: %', rcpt_hdr_row.rcpt_date, NEW.rcpt_type_uid;
	END IF;
	
--	Receipt Distribution Type:
--	uid = 4 is Royalty
--	uid = 5 is Lease bonus -- used only to update the lease bonus paid date, lease.date_deposited
--	uid = 6 is Lease Rental
--	uid = 7 is Blanchard
--	uid = 8 is Excess Royalty
--	uid = 10 is Net Profit Payment
--	uid = 11 is Overriding
--	uid = 12 is Production Payments
--	uid = 13 is Special Overriding Royalty
--	uid = 15 is Working

--      == Update Division Order first and last dates ==============================================
	IF show_debug_info THEN
		RAISE INFO 'NEW.division_order_uid: %', NEW.division_order_uid;
	END IF;
	
	IF coalesce(NEW.division_order_uid,0) > 0 AND NEW.rcpt_type_uid IN (4,6,7,8,10,11,12,13,15) THEN
		SELECT * INTO division_order_row
		FROM division_order
		WHERE division_order_uid = NEW.division_order_uid;

		IF show_debug_info THEN
			RAISE INFO 'prev division_order.date_paid_first: %, division_order.date_last_paid: %', division_order_row.date_paid_first, division_order_row.date_last_paid;
		END IF;
	
		IF division_order_row.date_paid_first IS NULL THEN
			UPDATE division_order
			SET date_paid_first = rcpt_hdr_row.rcpt_date
			WHERE division_order_uid = NEW.division_order_uid;
		END IF;
		IF division_order_row.date_last_paid IS NULL OR division_order_row.date_last_paid < rcpt_hdr_row.rcpt_date THEN
			UPDATE division_order
			SET date_last_paid = rcpt_hdr_row.rcpt_date
			WHERE division_order_uid = NEW.division_order_uid;
		END IF;
	END IF;

--      == Update Lease first and last dates ==============================================
	IF show_debug_info THEN
		RAISE INFO 'NEW.lease_uid: %', NEW.lease_uid;
	END IF;

	IF coalesce(NEW.lease_uid,0) > 0 AND NEW.rcpt_type_uid IN (4,6,7,8,10,11,12,13,15,5) THEN --(NEW.rcpt_type_uid = 4 OR NEW.rcpt_type_uid = 5 OR NEW.rcpt_type_uid = 6) THEN
		SELECT * INTO lease_row
		FROM lease
		WHERE lease_uid = NEW.lease_uid;

		IF show_debug_info THEN
			RAISE INFO 'prev lease.date_first_pmt: %, lease.date_last_pmt: %, lease.date_deposited: %', lease_row.date_first_pmt, lease_row.date_last_pmt, lease_row.date_deposited;
		END IF;

		IF NEW.rcpt_type_uid IN (4,6,7,8,10,11,12,13,15) THEN
			IF lease_row.date_first_pmt IS NULL THEN
				UPDATE lease
				SET date_first_pmt = rcpt_hdr_row.rcpt_date
				WHERE lease_uid = NEW.lease_uid;
			END IF;
			IF lease_row.date_last_pmt IS NULL OR lease_row.date_last_pmt < rcpt_hdr_row.rcpt_date THEN
				UPDATE lease
				SET date_last_pmt = rcpt_hdr_row.rcpt_date
				WHERE lease_uid = NEW.lease_uid;
			END IF;
		END IF;

		IF NEW.rcpt_type_uid = 5 THEN
			UPDATE lease
			SET date_deposited = rcpt_hdr_row.rcpt_date
			WHERE lease_uid = NEW.lease_uid;
		END IF;
		
		IF lease_row.last_payor_uid IS NULL THEN
			UPDATE lease SET last_payor_uid = rcpt_hdr_row.customer_uid WHERE lease_uid = NEW.lease_uid;
		END IF;
		
	END IF;

--      == Update Well first and last dates ==============================================
	IF show_debug_info THEN
		RAISE INFO 'NEW.well_uid: %', NEW.well_uid;
	END IF;

	IF coalesce(NEW.well_uid,0) > 0 AND NEW.rcpt_type_uid IN (4,6,7,8,10,11,12,13,15,5) THEN
		SELECT * INTO well_row
		FROM well
		WHERE well_uid = NEW.well_uid;

		IF show_debug_info THEN
			RAISE INFO 'prev well.date_paid_first: %, well.date_last_paid: %', well_row.date_paid_first, well_row.date_last_paid;
		END IF;

		IF well_row.date_paid_first IS NULL THEN
			UPDATE well
			SET date_paid_first = rcpt_hdr_row.rcpt_date
			WHERE well_uid = NEW.well_uid;
		END IF;
		IF well_row.date_last_paid IS NULL OR well_row.date_last_paid < rcpt_hdr_row.rcpt_date THEN
			UPDATE well
			SET date_last_paid = rcpt_hdr_row.rcpt_date
			WHERE well_uid = NEW.well_uid;
		END IF;
	END IF;

--      == Update Owner Number first and last dates ==============================================
	IF show_debug_info THEN
		RAISE INFO 'rcpt_hdr_row.owner_number: %', rcpt_hdr_row.owner_number;
	END IF;

	IF length(coalesce(rcpt_hdr_row.owner_number,'')) > 0 THEN
		SELECT * INTO customer_owner_number_row
		FROM customer_owner_number
		WHERE owner_number = rcpt_hdr_row.owner_number AND customer_uid = rcpt_hdr_row.customer_uid;

		IF show_debug_info THEN
			RAISE INFO 'customer_owner_number.date_first_paid: %, customer_owner_number.date_last_paid: %', customer_owner_number_row.date_first_paid, customer_owner_number_row.date_last_paid;
		END IF;

		IF customer_owner_number_row.date_first_paid IS NULL THEN
			UPDATE customer_owner_number
			SET date_first_paid = rcpt_hdr_row.rcpt_date
			WHERE owner_number = rcpt_hdr_row.owner_number AND customer_uid = rcpt_hdr_row.customer_uid;
		END IF;
		IF customer_owner_number_row.date_last_paid IS NULL OR customer_owner_number_row.date_last_paid < rcpt_hdr_row.rcpt_date THEN
			UPDATE customer_owner_number
			SET date_last_paid = rcpt_hdr_row.rcpt_date
			WHERE owner_number = rcpt_hdr_row.owner_number AND customer_uid = rcpt_hdr_row.customer_uid;
		END IF;
	END IF;

      RETURN NEW;
END;

$$;


