-- Name: vw_active_companies; Type: VIEW; Schema: public; Owner: prm_master
--

CREATE VIEW public.vw_active_companies AS
 SELECT c.name
   FROM (public.customer c
     RIGHT JOIN public.lease l ON ((l.lessee_id = c.id)))
  WHERE ((COALESCE(c.deadfiled, false) = false) AND (COALESCE(l.deadfiled, false) = false))
UNION
 SELECT c.name
   FROM (public.customer c
     RIGHT JOIN public.division_order d ON ((d.lessee_id = c.id)))
  WHERE ((COALESCE(c.deadfiled, false) = false) AND (COALESCE(d.deadfiled, false) = false));


