--
-- TOC entry 381 (class 1259 OID 17425)
-- Name: vw_active_customers; Type: VIEW; Schema: public; Owner: prm_master
--

CREATE VIEW public.vw_active_customers AS
 SELECT c.name,
    c.address,
    c.city,
    c.state,
    c.zipcode,
    c.customernumber,
    c.taxnumber,
    c.defunct,
    c.customer_uid
   FROM public.customer c,
    public.lease l
  WHERE ((c.id = l.lessee_id) AND ((COALESCE(c.deadfiled, false) = false) AND (COALESCE(l.deadfiled, false) = false)))
UNION
 SELECT c.name,
    c.address,
    c.city,
    c.state,
    c.zipcode,
    c.customernumber,
    c.taxnumber,
    c.defunct,
    c.customer_uid
   FROM public.customer c,
    public.division_order d
  WHERE ((c.id = d.lessee_id) AND ((COALESCE(c.deadfiled, false) = false) AND (COALESCE(d.deadfiled, false) = false)))
UNION
 SELECT c.name,
    c.address,
    c.city,
    c.state,
    c.zipcode,
    c.customernumber,
    c.taxnumber,
    c.defunct,
    c.customer_uid
   FROM public.customer c,
    public.well w
  WHERE ((c.id = w.operator_uid) AND ((COALESCE(c.deadfiled, false) = false) AND (COALESCE(w.deadfiled, false) = false)));


