--
-- TOC entry 384 (class 1259 OID 17438)
-- Name: vw_customer_on_receipt; Type: VIEW; Schema: public; Owner: prm_master
--

CREATE VIEW public.vw_customer_on_receipt AS
 SELECT 'Receipt'::text AS rel,
    rh.rcpt_number AS relname,
    rh.rcpt_number AS relnumber,
    rh.rcpt_date AS reldate,
    rh.rcpt_hdr_uid AS reluid,
    c.name AS custname,
    c.customer_uid AS cuid,
        CASE
            WHEN (rh.payee_id = c.customer_uid) THEN 'Payee'::text
            ELSE 'Payor'::text
        END AS reltype
   FROM (public.customer c
     JOIN public.rcpt_hdr rh ON (((rh.customer_uid = c.customer_uid) OR (rh.payee_id = c.customer_uid))))
  WHERE (rh.deadfiled IS NOT TRUE)
UNION
 SELECT 'Lease'::text AS rel,
    l.lease_name AS relname,
    l.doc_id AS relnumber,
    l.date_received AS reldate,
    l.lease_uid AS reluid,
    c.name AS custname,
    c.customer_uid AS cuid,
        CASE
            WHEN (l.lessee_id = c.customer_uid) THEN 'Lessee'::text
            ELSE
            CASE
                WHEN (l.lessor_id = c.customer_uid) THEN 'Lessor'::text
                ELSE 'Customer'::text
            END
        END AS reltype
   FROM (public.customer c
     JOIN public.lease l ON (((l.lessee_id = c.customer_uid) OR (l.lessor_id = c.customer_uid) OR (l.customer_uid = c.customer_uid))))
  WHERE (l.deadfiled IS NOT TRUE)
UNION
 SELECT 'Division Order'::text AS rel,
    d.well_name AS relname,
    d.do_num AS relnumber,
    d.date_received AS reldate,
    d.division_order_uid AS reluid,
    c.name AS custname,
    c.customer_uid AS cuid,
        CASE
            WHEN (d.operator_uid = c.customer_uid) THEN 'Operator'::text
            ELSE
            CASE
                WHEN (d.lessee_id = c.customer_uid) THEN 'Payor'::text
                ELSE 'Issuer'::text
            END
        END AS reltype
   FROM (public.customer c
     JOIN public.division_order d ON (((d.lessee_id = c.customer_uid) OR (d.operator_uid = c.customer_uid) OR (d.customer_uid = c.customer_uid))))
  WHERE (d.deadfiled IS NOT TRUE)
UNION
 SELECT 'Well'::text AS rel,
    w.well_name AS relname,
    w.well_number AS relnumber,
    w.date_spudded_in AS reldate,
    w.well_uid AS reluid,
    c.name AS custname,
    c.customer_uid AS cuid,
    'Operator'::text AS reltype
   FROM (public.customer c
     JOIN public.well w ON ((w.operator_uid = c.customer_uid)))
  WHERE (w.deadfiled IS NOT TRUE)
UNION
 SELECT 'Title'::text AS rel,
    l.ttl_desc AS relname,
    l.ttl_code AS relnumber,
    l.ttl_grant_date AS reldate,
    l.legal_title_uid AS reluid,
    c.name AS custname,
    c.customer_uid AS cuid,
        CASE
