    l.lease_description,
    l.term_interest_fractional,
    l.term_acre_rental,
    l.term_net_acre,
    l.gross_net_ind,
    ( SELECT string_agg((product_type.product_type_name)::text, ', '::text) AS product_types
           FROM public.product_type
          WHERE (product_type.product_type_uid IN ( SELECT b.product_type_uid
                   FROM public.lease_product_type b
                  WHERE (b.lease_uid = l.lease_uid)))) AS lease_product_types,
    sc.stname,
    sc.ctname,
    sc.stalpha,
    c.id AS customer_id,
    c.customer_uid,
