   FROM ((((((public.lease l
     LEFT JOIN public.customer c ON ((c.customer_uid = l.customer_uid)))
     LEFT JOIN public.customer c2 ON ((c2.customer_uid = l.lessor_id)))
     LEFT JOIN public.vw_state_county sc ON ((sc.ctnum = l.ctnum)))
     LEFT JOIN public.vw_lease_legal_desc lld ON ((lld.lease_uid = l.lease_uid)))
     LEFT JOIN public.vw_lease_title lt ON ((lt.lease_uid = l.lease_uid)))
     JOIN public.doc_type dtp ON ((dtp.doc_type_uid = l.doc_type_uid)))
  WHERE (COALESCE(l.deadfiled, false) = false);


