-- Name: vw_receipt_detail; Type: VIEW; Schema: public; Owner: prm_master
--

CREATE VIEW public.vw_receipt_detail AS
 SELECT rh.rcpt_hdr_uid,
    rh.rcpt_date,
    (date_trunc('month'::text, (rh.rcpt_date)::timestamp with time zone))::date AS rcpt_date_sort,
    rh.date_received,
    rh.deposit_date,
    rh.rcpt_number,
    COALESCE(rh.rcpt_amt, 0.00) AS rcpt_amt,
    rh.de_dt,
    rh.dm_dt,
    rh.payee_id,
    rh.customer_uid,
    p.name AS payee,
    c.name AS receipt_customer,
    rd.rcpt_dist_uid,
    rd.from_date,
    rd.sale_quantity,
    COALESCE(rd.sale_unit_price, 0.00) AS sale_unit_price,
    COALESCE(rd.sale_gross_amt, 0.00) AS sale_gross_amt,
    COALESCE(rd.sale_net_amt, 0.00) AS sale_net_amt,
    COALESCE(rd.owner_net_amt, 0.00) AS owner_net_amt,
    rd.decimal_interest,
    COALESCE(( SELECT sum(COALESCE(rdd.owner_amt, 0.00)) AS sum
           FROM (public.rcpt_dist_detail rdd
             JOIN public.rcpt_distribution_type rdt ON ((rdt.rcpt_distribution_type_uid = rdd.rcpt_distribution_type_uid)))
          WHERE (((rdt.rcpt_distribution_type_code)::text = 'Gross Amount'::text) AND (rdd.rcpt_dist_uid = rd.rcpt_dist_uid) AND (rdd.deadfiled <> true))), 0.00) AS owner_gross_amt,
    COALESCE(( SELECT sum(COALESCE(rdd.owner_amt, 0.00)) AS sum
           FROM (public.rcpt_dist_detail rdd
             JOIN public.rcpt_distribution_type rdt ON ((rdt.rcpt_distribution_type_uid = rdd.rcpt_distribution_type_uid)))
          WHERE (((rdt.rcpt_distribution_type_name)::text ~~* '%tax%'::text) AND (rdd.rcpt_dist_uid = rd.rcpt_dist_uid) AND (rdd.deadfiled <> true))), 0.00) AS owner_tax_amt,
    rt.rcpt_type_name,
    pt.product_type_name AS product_type,
    w.well_uid,
    w.well_name,
    ( SELECT well_status.well_status_name
           FROM public.well_status
          WHERE ((well_status.well_status_code)::text = (w.well_status_code)::text)) AS well_status,
    COALESCE(w.ctnum, 0) AS well_ctnum,
    COALESCE(stct.stnum, 0) AS well_stnum,
    COALESCE(w.state_no, ''::character varying) AS well_state_no,
    COALESCE(stct.ctname, 'County Unknown'::character varying) AS well_county,
    COALESCE(gs.stname, 'State Unknown'::character varying) AS well_state,
    wo.name AS well_operator,
    l.lease_name,
    l.lease_description,
    lc.name AS lease_customer,
    les.name AS lease_lessee,
    lor.name AS lease_lessor,
    divo.do_num,
    divo.date_received AS do_received,
    divo.date_executed AS do_executed,
    divc.name AS do_customer,
    dol.name AS do_lessee,
    doo.name AS do_operator,
    pt.product_type_code
   FROM (((((((((((((((((((((((((((public.rcpt_hdr rh
     LEFT JOIN public.customer c ON ((c.customer_uid = rh.customer_uid)))
     LEFT JOIN public.customer p ON ((p.customer_uid = rh.payee_id)))
     JOIN public.rcpt_dist rd ON (((rd.rcpt_hdr_uid = rh.rcpt_hdr_uid) AND (COALESCE(rd.deadfiled, false) = false))))
     LEFT JOIN public.rcpt_type rt ON ((rt.rcpt_type_uid = rd.rcpt_type_uid)))
     LEFT JOIN public.product_type pt ON ((pt.product_type_uid = rd.product_type_uid)))
     LEFT JOIN public.well w ON ((w.well_uid = rd.well_uid)))
     LEFT JOIN public.customer wo ON ((wo.customer_uid = w.operator_uid)))
     LEFT JOIN public.gpcounty stct ON ((stct.ctnum = w.ctnum)))
     LEFT JOIN public.gpstate gs ON ((gs.stnum = stct.stnum)))
     LEFT JOIN public.legal_desc_well ldw ON ((ldw.well_uid = w.well_uid)))
     LEFT JOIN public.well_lease wll ON ((wll.legal_desc_well_uid = ldw.legal_desc_well_uid)))
     LEFT JOIN public.legal_desc_lease ldl ON ((ldl.legal_desc_lease_uid = wll.legal_desc_lease_uid)))
     LEFT JOIN public.lease wl ON ((wl.lease_uid = ldl.lease_uid)))
     LEFT JOIN public.well_division wd ON ((wd.legal_desc_well_uid = ldw.legal_desc_well_uid)))
     LEFT JOIN public.legal_desc_div ldd ON ((ldd.legal_desc_div_uid = wd.legal_desc_div_uid)))
     LEFT JOIN public.division_order wdo ON ((wdo.division_order_uid = ldd.division_order_uid)))
     LEFT JOIN public.well_title wt ON ((wt.legal_desc_well_uid = ldw.legal_desc_well_uid)))
     LEFT JOIN public.legal_desc_title ldt ON ((ldt.legal_desc_title_uid = wt.legal_desc_title_uid)))
     LEFT JOIN public.legal_title wlt ON ((wlt.legal_title_uid = ldt.legal_title_uid)))
     LEFT JOIN public.lease l ON ((l.lease_uid = rd.lease_uid)))
     LEFT JOIN public.customer lc ON ((lc.customer_uid = l.customer_uid)))
     LEFT JOIN public.customer les ON ((les.customer_uid = l.lessee_id)))
     LEFT JOIN public.customer lor ON ((lor.customer_uid = l.lessor_id)))
     LEFT JOIN public.division_order divo ON ((divo.division_order_uid = rd.division_order_uid)))
     LEFT JOIN public.customer divc ON ((divc.customer_uid = divo.customer_uid)))
     LEFT JOIN public.customer dol ON ((dol.customer_uid = divo.lessee_id)))
     LEFT JOIN public.customer doo ON ((doo.customer_uid = divo.operator_uid)))
  WHERE (COALESCE(rh.deadfiled, false) = false);


