    concat(ldt.tr_twnshp_num, "left"((ldt.tr_twnshp_drctn)::text, 1)) AS tr_twnshp,
    concat(ldt.tr_range_num, "left"((ldt.tr_range_drctn)::text, 1)) AS tr_range,
    vsc.stalpha,
    vsc.ctname,
    ldt.tr_gross_acres,
    ldt.tr_net_acres,
    ldt.tr_free_acres,
    ldt.tr_block,
    ldt.tr_lot,
    ldt.tr_desc,
    ldt.tr_fractional,
    ldt.tr_decimal,
    ((( SELECT count(*) AS count
           FROM ((public.lease l
             JOIN public.legal_desc_lease ldl USING (lease_uid))
             JOIN public.lease_title lt2 ON ((lt2.legal_desc_lease_uid = ldl.legal_desc_lease_uid)))
          WHERE (((l.date_effective + ((l.term_years)::double precision * '1 year'::interval)) > now()) AND (lt2.legal_desc_title_uid = ldt.legal_desc_title_uid) AND ((COALESCE(l.deadfiled, false) = false) AND (COALESCE(ldl.deadfiled, false) = false)))))::integer)::boolean AS leased,
    ((( SELECT count(*) AS count
           FROM ((((public.division_order
             JOIN public.legal_desc_div ldd USING (division_order_uid))
             JOIN public.rcpt_dist rd USING (division_order_uid))
             JOIN public.rcpt_hdr rh ON ((rh.rcpt_hdr_uid = rd.rcpt_hdr_uid)))
             JOIN public.division_title dt ON ((dt.legal_desc_div_uid = ldd.legal_desc_div_uid)))
          WHERE ((rh.rcpt_date <= now()) AND (rh.rcpt_date >= (now() - '1 year'::interval)) AND (dt.legal_desc_title_uid = ldt.legal_desc_title_uid) AND ((COALESCE(division_order.deadfiled, false) = false) AND (COALESCE(ldd.deadfiled, false) = false) AND (COALESCE(rd.deadfiled, false) = false) AND (COALESCE(rh.deadfiled, false) = false)))))::integer)::boolean AS hbp
   FROM (((public.legal_desc_title ldt
     JOIN public.legal_title lt1 ON ((ldt.legal_title_uid = lt1.legal_title_uid)))
     JOIN public.customer c ON ((lt1.grantee_uid = c.customer_uid)))
     JOIN public.vw_state_county vsc ON ((vsc.ctnum = ldt.tr_ctnum)))
  WHERE ((COALESCE(ldt.deadfiled, false) = false) AND (COALESCE(lt1.deadfiled, false) = false) AND (COALESCE(c.deadfiled, false) = false));


