            WHEN (((COALESCE(o.well_name, ''::character varying))::text > ''::text) AND ((COALESCE(o.well_number, ''::character varying))::text = ''::text)) THEN ((((d.source_file_name)::text || ' (Well: '::text) || (o.well_name)::text) || ')'::text)
            WHEN (((COALESCE(o.well_name, ''::character varying))::text = ''::text) AND ((COALESCE(o.well_number, ''::character varying))::text > ''::text)) THEN ((((d.source_file_name)::text || ' (Well: '::text) || (o.well_number)::text) || ')'::text)
            ELSE ''::text
        END AS descr,
    u.usr_name AS deleted_by,
    d.dm_dt AS date_deleted,
    dl.doc_uid AS tablename_uid,
    'document_well'::text AS tablename,
    u.user_hdr_uid,
    dl.well_uid AS parent_uid
   FROM (((public.document_well dl
     JOIN public.document d ON ((d.doc_uid = dl.doc_uid)))
     JOIN public.well o ON ((o.well_uid = dl.well_uid)))
     JOIN public.user_hdr u ON ((u.user_hdr_uid = d.dm_usr)))
  WHERE (d.deadfiled IS TRUE);


ALTER TABLE public.vw_trashbin OWNER TO prm_master;

