--
-- TOC entry 450 (class 1259 OID 17766)
-- Name: vw_well_display; Type: VIEW; Schema: public; Owner: prm_master
--

CREATE VIEW public.vw_well_display AS
 SELECT w.well_number,
    w.well_name,
    w.date_paid_first,
    ws.well_status_name AS status_name,
    w.date_last_paid,
    w.date_spudded_in,
    sc.ctname,
    sc.stname,
    w.ctnum,
    w.file_location,
    w.de_dt,
    w.de_usr,
    w.dm_dt,
    w.dm_usr,
    w.deadfiled,
    w.doc_id,
    w.well_uid,
    w.operator_uid,
    w.well_status,
    w.state_no,
    w.well_status_code,
    c.name AS operator_name,
    ldw.tr_type
   FROM ((((public.well w
     LEFT JOIN public.vw_state_county sc ON ((sc.ctnum = w.ctnum)))
     LEFT JOIN public.well_status ws ON (((ws.well_status_code)::text = (w.well_status_code)::text)))
     LEFT JOIN public.customer c ON ((c.customer_uid = w.operator_uid)))
     LEFT JOIN public.legal_desc_well ldw ON ((ldw.well_uid = w.well_uid)))
  WHERE ((COALESCE(w.deadfiled, false) = false) AND (COALESCE(c.deadfiled, false) = false));


ALTER TABLE public.vw_well_display OWNER TO prm_master;

--
-- TOC entry 451 (class 1259 OID 17771)
-- Name: vw_well_legal_desc; Type: VIEW; Schema: public; Owner: prm_master
--

CREATE VIEW public.vw_well_legal_desc AS
 SELECT ((((b.well_name)::text || ' ('::text) || (b.well_number)::text) || ')'::text) AS well_name,
    a.tr_origin,
    a.tr_abstract,
    a.tr_section,
    a.tr_twnshp_num,
    a.tr_twnshp_drctn,
    a.tr_range_num,
    a.tr_range_drctn,
    a.tr_block,
    a.tr_lot,
    a.tr_desc,
    a.tr_fractional,
    a.tr_decimal,
    a.tr_gross_acres,
    a.tr_net_acres,
    a.tr_free_acres,
    a.tr_well_name,
    a.tr_notes,
    a.tr_prod,
    a.tr_ctnum,
    a.tr_type,
    a.de_dt,
    a.de_usr,
    a.dm_dt,
    a.dm_usr,
    a.deadfiled,
    a.legal_desc_well_uid,
    b.well_uid,
    a.fts_vector
   FROM (public.legal_desc_well a
     JOIN public.well b ON (((a.well_uid)::text = (b.well_uid)::text)))
  WHERE ((COALESCE(a.deadfiled, false) = false) AND (COALESCE(b.deadfiled, false) = false))
  ORDER BY a.tr_section, a.tr_twnshp_num, a.tr_twnshp_drctn, a.tr_range_num, a.tr_range_drctn;


